import { MapContainer } from 'https://cdn.esm.sh/react-leaflet/MapContainer'



export default function Map() {
  return (
    <div className="map">
        <MapContainer center={[50.5, 30.5]} zoom={13}>

        </MapContainer>
    </div>
  )
}
